lse,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',11,5,'','',1,290,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(3,35,'Messages','messages','<p>Joomla! offers three different types of messages. Creatings standard information about Joomla! system is presented depending on a message type as follows:</p>\r\n<p style=\"margin: 43px 0 0;\"></p>\r\n<dl id=\"system-message\"><dt class=\"error\">Error</dt><dd class=\"message message fade\">\r\n<ul>\r\n<li>This is a sample message</li>\r\n</ul>\r\n</dd></dl><dl id=\"system-message\"><dt class=\"error\">Error</dt><dd class=\"notice message fade\">\r\n<ul>\r\n<li>This is a sample of notice message</li>\r\n</ul>\r\n</dd></dl><dl id=\"system-message\"><dt class=\"error\">Error</dt><dd class=\"error message fade\">\r\n<ul>\r\n<li>This is a sample of error message</li>\r\n</ul>\r\n</dd></dl>','',1,7,'2011-01-12 17:08:51',142,'','2013-02-01 11:57:00',142,0,'0000-00-00 00:00:00','2011-01-12 17:08:51','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"0\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',10,4,'','',1,413,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(18,52,'Module variations','module-variations','<p>On this page you can see basic suffixes used in this template.</p>\r\n<p class=\"numblocks num-3\"><span>01</span>The <strong>clear</strong> suffix is very useful to create banners or images without additional borders, margins and paddings. The clear suffix is also very useful inside the <strong>mainbody</strong>, <strong>mainbody_top</strong> and <strong>mainbody_bottom</strong> module positions.</p>\r\n<p class=\"numblocks num-3\"><span>02</span>For News Show Pro GK5, Tabs GK5 and Image Show GK4 modules please always disable usage of the default CSS styles in the module settings.</p>\r\n<p class=\"numblocks num-3\"><span>03</span>If you want to put a banner in the inset, please also use the <strong>banner</strong> and <strong>clear</strong> suffixes.</p>\r\n<p class=\"numblocks num-3\"><span>04</span>If you want to remove the background image while using the module in the header on the frontpage, please add the <strong>noBg</strong> page suffix.</p>\r\n<p class=\"numblocks num-3\"><span>05</span>For modules which should have bigger width than other modules on the <strong>top1</strong>, <strong>top2</strong>, <strong>bottom1</strong>, <strong>bottom2</strong> or <strong>bottom3</strong> module position, please add the <strong>double</strong> suffix. Please remember that this suffix should be applied to the first module in the group. Otherwise it won\'t work.</p>\r\n<p class=\"numblocks num-3\"><span>06</span>The <strong>newsletter</strong> suffix should be used if you want to place the newsletter module on the right side of the modules group.</p>\r\n<p class=\"numblocks num-3\"><span>07</span>The News Show Pro GK5 module has few additional suffixes: <strong>list</strong> - for displaying items in one column with horizontal borders, <strong>list-small</strong> - the same as the previous suffix, but dedicated for small images in the articles on the left, <strong>showcase</strong> - for displaying articles with header overlaying the image and with icon over the image, <strong>showcase-small</strong> - similar to the previous suffix, but without the icon over image and with smaller header over the image.</p>\r\n<p class=\"numblocks num-3\"><span>08</span>For the <strong>banner_right</strong> module position, we have created the special module suffix - <strong>highlights</strong></p>\r\n<p class=\"numblocks num-3\"><span>09</span> If you want to display tabs over the header image in the <strong>banner_left</strong> module position please also add the <strong>transparent</strong> suffix.</p>\r\n<p class=\"numblocks num-3\"><span>10</span>You can put an icon to the module title using the following syntax in the title: <strong>[icon-NAME]</strong> i.e. <strong>[icon-cog]</strong>. Additionally you can specify the icon color using one of the following classes: <strong>icon-color1</strong>, <strong>icon-color2</strong>, <strong>icon-color3</strong>, <strong>icon-color4</strong>.</p>\r\n\r\n','',1,7,'2011-01-13 12:30:01',142,'','2014-01-05 16:50:51',981,0,'0000-00-00 00:00:00','2011-01-13 12:30:01','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_