iet elementum, nunc quam gravida mi, vehicula euismod magna lacus ornare mauris. Proin euismod scelerisque risus. Vivamus imperdiet hendrerit ornare. Phasellus dapibus imperdiet nibh, nec sagittis odio condimentum sed. Phasellus dignissim, massa nec ornare fermentum, ligula massa varius dolor, a interdum nisl purus eu magna. </p>\r\n','\r\n\r\n<p>Ut imperdiet ipsum vel est congue, a vestibulum orci faucibus. Mauris dictum orci ornare arcu placerat, eu porta quam sollicitudin. Fusce in dapibus turpis. Curabitur imperdiet fermentum tellus, nec eleifend felis pharetra vel. Praesent lobortis, arcu eu tempor dapibus, justo quam sagittis turpis, in adipiscing felis enim sit amet sem. </p>\r\n\r\n<ul>\r\n          <li>Nunc viverra elit risus, adipiscing placerat nibh malesuada nec. Quisque accumsan placerat odio, a sodales arcu sollicitudin non. </li>\r\n          <li>Vivamus bibendum condimentum lacus, id fermentum dolor. Cras placerat nisl sed eros rutrum porttitor. Proin quis laoreet est. Sed ac ultricies nunc.</li>\r\n          \r\n</ul>\r\n<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Phasellus rutrum, libero id imperdiet elementum, nunc quam gravida mi, vehicula euismod magna lacus ornare mauris. Proin euismod scelerisque risus. Vivamus imperdiet hendrerit ornare. Phasellus dapibus imperdiet nibh, nec sagittis odio condimentum sed. </p>',1,38,'2014-01-04 12:35:28',981,'','2014-01-04 12:49:46',981,0,'0000-00-00 00:00:00','2014-01-04 12:35:28','0000-00-00 00:00:00','{\"image_intro\":\"images\\/demo\\/batman-thumbs.jpg\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"images\\/demo\\/5a61d31ed794cb758475f6c89477dfed_XL.jpg\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',7,0,'','',1,4,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(99,186,'Custom HTML elements','custom-html-elements','<h3>Columns</h3>\r\n\r\n<p style=\"text-align: center;\"><img src=\"images/demo/columns.png\" alt=\"Columns\" /></p>\r\n\r\n<p>Columns needs main wrapper with <strong>gkCols</strong> class and <strong>data-cols</strong> attribute:</p>\r\n\r\n<pre>&lt;div class=\"gkCols\" data-cols=\"2\"&gt;\r\n&lt;div&gt;\r\nFirst column content\r\n&lt;/div&gt;\r\n&lt;div&gt;\r\nSecond column content\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n</pre>\r\n\r\n<p>You can create a layout with <strong>2-5</strong> columns using this structure.</p>\r\n\r\n<h3>Newsletter</h3>\r\n\r\n<p style=\"text-align: center;\"><img src=\"images/demo/newsletter.png\" alt=\"Newsletter\" /></p>\r\n\r\n<p>The newsletter custom HTML code is a structure for very simple newsletter form:</p>\r\n\r\n<pre>&lt;form action=\"#\" class=\"gk-newsletter\"&gt;\r\n&lt;p&gt;&lt;input type=\"email\" placeholder=\"Enter Email Address\"&gt; &lt;input type=\"button\" value=\"Join\"&gt;&lt;/p&gt;\r\n&lt;/form&gt;</pre>\r\n\r\n<p>As you can see it uses the <strong>form</strong> element with <strong>gk-newsletter</strong> CSS class, and two basic input fields.</p>\r\n\r\n<h3>Social icons</h3>\r\n\r\n<p style=\"text-align: center;\"><img src=\"images/demo/social_icons.png\" alt=\"Social icons\" /></p>\r\n\r\n<p>Social icons have a very simple structure based on links placed in the container with <strong>gk-social</strong> class:</p>\r\n\r\n<pre>&lt;div class=\"gk-social\"&gt;\r\n&lt;a href=\"#\" class=\"gk-twitter\"&gt;twitter.com/game&lt;/a&gt;\r\n&lt;a href=\"#\" class=\"gk-facebook\"&gt;facebook.com/game&lt;/a&gt;\r\n&lt;a href=\"#\" class=\"gk-youtube\"&gt;youtube.com/game&lt;/a&gt;\r\n&lt;a href=\"#\" class=\"gk-gplus\"&gt;plus.google.com/+game&lt;/a&gt;\r\n&lt;/div&gt;</pre>\r\n\r\n<h3>Banners</h3>\r\n\r\n<p style=\"text-align: center;\"><img src=\"images/demo/banner.png\" alt=\"Banner\" /></p>\r\n\r\n<p>If you want to create a banner inside the <strong>inset</strong> column, please use the following syntax:</p>\r\n\r\n<pre>&lt;a href=\"#\" class=\"gkBanner\"&gt;&lt;img src=\"/templates/2013_12/images/demo/banner_inset.jpg\" alt=\"Banner\"&gt;&lt;/a&gt;</pre>\r\n\r\n<h3>Page Title</h3>\r\n\r\n<p style=\"text-align: center;\"><img src=\"images/demo/page_title.png\" alt=\"Page title\" /></p>\r\n\r\n<p>The page title element is created from the active menu item title attribute, or if it is blank - from the menu item name:</p>\r\n\r\n<p style=\"text-align: center;\"><img src=\"images/demo/page_title_value.png\" alt=\"Page title - value\" /></p>\r\n\r\n<p>If you want to disable the page title totally or on the specific pages - you can use the following options in the template \"Features\" settings:</p>\r\n\r\n<p style=\"text-align: center;\"><img src=\"images/demo/page_title_settings.png\" alt=\"Page title - settings\" /></p>\r\n\r\n<p>Please remember that you can: enable page title on the specific pages or disable page title on the specific pages. Of course without adding rules for the specific menu items or components you can enable/disable page title for all pages.</p>','',1,7,'2014-01-05 17:13:48',981,'','0000-00-00 00:00:00',0,0,'0000-00-00 00:00:00','2014-01-05 17:13:48','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',1,0,'','',1,6,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*','');


