ring\";s:1:\"5\";s:8:\"category\";s:17:\"Template articles\";s:9:\"cat_state\";s:1:\"1\";s:10:\"cat_access\";s:1:\"1\";s:4:\"slug\";s:20:\"18:module-variations\";s:7:\"catslug\";s:10:\"7:template\";s:6:\"author\";N;s:6:\"layout\";s:7:\"article\";s:4:\"path\";s:86:\"index.php/template/template-features/module-variations/7-template/18-module-variations\";s:10:\"metaauthor\";N;}s:15:\"\0*\0instructions\";a:5:{i:1;a:3:{i:0;s:5:\"title\";i:1;s:8:\"subtitle\";i:2;s:2:\"id\";}i:2;a:2:{i:0;s:7:\"summary\";i:1;s:4:\"body\";}i:3;a:8:{i:0;s:4:\"meta\";i:1;s:10:\"list_price\";i:2;s:10:\"sale_price\";i:3;s:7:\"metakey\";i:4;s:8:\"metadesc\";i:5;s:10:\"metaauthor\";i:6;s:6:\"author\";i:7;s:16:\"created_by_alias\";}i:4;a:2:{i:0;s:4:\"path\";i:1;s:5:\"alias\";}i:5;a:1:{i:0;s:8:\"comments\";}}s:11:\"\0*\0taxonomy\";a:3:{s:4:\"Type\";a:1:{s:7:\"Article\";O:7:\"JObject\":4:{s:10:\"\0*\0_errors\";a:0:{}s:5:\"title\";s:7:\"Article\";s:5:\"state\";i:1;s:6:\"access\";i:1;}}s:8:\"Category\";a:1:{s:17:\"Template articles\";O:7:\"JObject\":4:{s:10:\"\0*\0_errors\";a:0:{}s:5:\"title\";s:17:\"Template articles\";s:5:\"state\";i:1;s:6:\"access\";i:1;}}s:8:\"Language\";a:1:{s:1:\"*\";O:7:\"JObject\":4:{s:10:\"\0*\0_errors\";a:0:{}s:5:\"title\";s:1:\"*\";s:5:\"state\";i:1;s:6:\"access\";i:1;}}}s:3:\"url\";s:47:\"index.php?option=com_content&view=article&id=18\";s:5:\"route\";s:93:\"index.php?option=com_content&view=article&id=18:module-variations&catid=7:template&Itemid=127\";s:5:\"title\";s:17:\"Module variations\";s:11:\"description\";s:1972:\"On this page you can see basic suffixes used in this template. 01 The clear suffix is very useful to create banners or images without additional borders, margins and paddings. The clear suffix is also very useful inside the mainbody , mainbody_top and mainbody_bottom module positions. 02 For News Show Pro GK5, Tabs GK5 and Image Show GK4 modules please always disable usage of the default CSS styles in the module settings. 03 If you want to put a banner in the inset, please also use the banner and clear suffixes. 04 If you want to remove the background image while using the module in the header on the frontpage, please add the noBg page suffix. 05 For modules which should have bigger width than other modules on the top1 , top2 , bottom1 , bottom2 or bottom3 module position, please add the double suffix. Please remember that this suffix should be applied to the first module in the group. Otherwise it won\'t work. 06 The newsletter suffix should be used if you want to place the newsletter module on the right side of the modules group. 07 The News Show Pro GK5 module has few additional suffixes: list - for displaying items in one column with horizontal borders, list-small - the same as the previous suffix, but dedicated for small images in the articles on the left, showcase - for displaying articles with header overlaying the image and with icon over the image, showcase-small - similar to the previous suffix, butwithout the icon over image and with smaller header over the image. 08 For the banner_right module position, we have created the special module suffix - highlights 09 If you want to display tabs over the header image in the banner_left module position please also add the transparent suffix. 10 You can put an icon to the module title using the following syntax in the title: [icon-NAME] i.e. [icon-cog] . Additionally you can specify the icon color using one of the following classes: icon-color1 , icon-color2 , icon-color3 , icon-color4 .\";s:9:\"published\";N;s:5:\"state\";i:1;s:6:\"access\";s:1:\"1\";s:8:\"language\";s:1:\"*\";s:18:\"publish_start_date\";s:19:\"2011-01-13 12:30:01\";s:16:\"publish_end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"start_date\";s:19:\"2011-01-13 12:30:01\";s:8:\"end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"list_price\";N;s:10:\"sale_price\";N;s:7:\"type_id\";i:4;}'),(456,'index.php?option=com_content&view=article&id=99','index.php?option=com_content&view=article&id=99:custom-html-elements&catid=7:template&Itemid=195','Custom HTML elements','Columns Columns needs main wrapper with gkCols class and data-cols attribute: <div class=\"gkCols\" data-cols=\"2\"> <div> First column content </div> <div> Second column content </div> </div> You can create a layout with 2-5 columns using this structure. New','2014-01-05 18:13:48','31bd52dfd3f5ac49aa6f80f3b4b114b5',1,1,1,'*','2014-01-05 17:13:48','0000-00-00 00:00:00','2014-01-05 17:13:48','0000-00-00 00:00:00',0,0,4,'O:19:\"FinderIndexerResult\":18:{s:11:\"\0*\0elements\";a:24:{s:2:\"id\";s:2:\"99\";s:5:\"alias\";s:20:\"custom-html-elements\";s:7:\"summary\";s:2846:\"<h3>Columns</h3>\r\n\r\n<p style=\"text-align: center;\"><img src=\"images/demo/columns.png\" alt=\"Columns\" /></p>\r\n\r\n<p>Columns needs main wrapper with <strong>gkCols</strong> class and <strong>data-cols</strong> attribute:</p>\r\n\r\n<pre>&lt;div class=\"gkCols\" data-cols=\"2\"&gt;\r\n&lt;div&gt;\r\nFirst column content\r\n&lt;/div&gt;\r\n&lt;div&gt;\r\nSecond column content\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n</pre>\r\n\r\n<p>You can create a layout with <strong>2-5</strong> columns using this structure.</p>\r\n\r\n<h3>Newsletter</h3>\r\n\r\n<p style=\"text-align: center;\"><img src=\"images/demo/newsletter.png\" alt=\"Newsletter\" /></p>\r\n\r\n<p>The newsletter custom HTML code is a structure for very simple newsletter form:</p>\r\n\r\n<pre>&lt;form action=\"#\" class=\"gk-newsletter\"&gt;\r\n&lt;p&gt;&lt;input type=\"email\" placeholder=\"Enter Email Address\"&gt; &lt;input type=\"button\" value=\"Join\"&gt;&lt;/p&gt;\r\n&lt;/form&gt;</pre>\r\n\r\n<p>As you can see it uses the <strong>form</strong> element with <strong>gk-newsletter</strong> CSS class, and two basic input fields.</p>\r\n\r\n<h3>Social icons</h3>\r\n\r\n<p style=\"text-align: center;\"><img src=\"images/demo/social_icons.png\" alt=\"Social icons\" /></p>\r\n\r\n<p>Social icons have a very simple structure based on links placed in the container with <strong>gk-social</strong> class:</p>\r\n\r\n<pre>&lt;div class=\"gk-social\"&gt;\r\n&lt;a href=\"#\" class=\"gk-twitter\"&gt;twitter.com/game&lt;/a&gt;\r\n&lt;a href=\"#\" class=\"gk-facebook\"&gt;facebook.com/game&lt;/a&gt;\r\n&lt;a href=\"#\" class=\"gk-youtube\"&gt;youtube.com/game&lt;/a&gt;\r\n&lt;a href=\"#\" class=\"gk-gplus\"&gt;plus.google.com/+game&lt;/a&gt;\r\n&lt;/div&gt;</pre>\r\n\r\n<h3>Banners</h3>\r\n\r\n<p style=\"text-align: center;\"><img src=\"images/demo/banner.png\" alt=\"Banner\" /></p>\r\n\r\n<p>If you want to create a banner inside the <strong>inset</strong> column, please use the following syntax:</p>\r\n\r\n<pre>&lt;a href=\"#\" class=\"gkBanner\"&gt;&lt;img src=\"/templates/2013_12/images/demo/banner_inset.jpg\" alt=\"Banner\"&gt;&lt;/a&gt;</pre>\r\n\r\n<h3>Page Title</h3>\r\n\r\n<p style=\"text-align: center;\"><img src=\"images/demo/page_title.png\" alt=\"Page title\" /></p>\r\n\r\n<p>The page title element is created from the active menu item title attribute, or if it is blank - from the menu item name:</p>\r\n\r\n<p style=\"text-align: center;\"><img src=\"images/demo/page_title_value.png\" alt=\"Page title - value\" /></p>\r\n\r\n<p>If you want to disable the page title totally or on the specific pages - you can use the following options in the template \"Features\" settings:</p>\r\n\r\n<p style=\"text-align: center;\"><img src=\"images/demo/page_title_settings.png\" alt=\"Page title - settings\" /></p>\r\n\r\n<p>Please remember that you can: enable page title on the specific pages or disable page title on the specific pages. Of course without adding rules for the specific menu items or components you can enable/disable page title for all pages.</p>\";s:4:\"body\";s:0:\"\";s:5:\"catid\";s:1:\"7\";s:10:\"created_by\";s:3:\"981\";s:16:\"created_by_alias\";s:0:\"\";s:8:\"modified\";s:19:\"0000-00-00 00:00:00\";s:11:\"modified_by\";s:1:\"0\";s:6:\"params\";O:9:\"JRegistry\":1:{s:7:\"\0*\0data\";O:8:\"stdClass\":69:{s:14:\"article_layout\";s:9:\"_:defaul